import React, { useState } from "react";
import { Card, CardHeader, CardBody, Row, Col, Table, FormGroup, Label, Input, Button } from "reactstrap";

function Typography() {
  const [batchId, setBatchId] = useState("");
  const [date, setDate] = useState("");
  const [time, setTime] = useState("");
  const [questionsFile, setQuestionsFile] = useState(null);
  const [exams, setExams] = useState([]);

  const handleAddExam = () => {
    const newExam = {
      batchId,
      date,
      time,
      questionsFile
    };

    setExams([...exams, newExam]);

    // Clear form fields after adding the exam
    setBatchId("");
    setDate("");
    setTime("");
    setQuestionsFile(null);
  };

  return (
    <>
      <div className="content">
        <Row>
          <Col md="12">
            <Card>
              <CardHeader>
                <h5 className="title">Add Exam</h5>
              </CardHeader>
              <CardBody>
                <FormGroup>
                  <Label for="batchId">Batch ID:</Label>
                  <Input
                    type="text"
                    id="batchId"
                    value={batchId}
                    onChange={(e) => setBatchId(e.target.value)}
                  />
                </FormGroup>
                <FormGroup>
                  <Label for="date">Date:</Label>
                  <Input
                    type="date"
                    id="date"
                    value={date}
                    onChange={(e) => setDate(e.target.value)}
                  />
                </FormGroup>
                <FormGroup>
                  <Label for="time">Time:</Label>
                  <Input
                    type="time"
                    id="time"
                    value={time}
                    onChange={(e) => setTime(e.target.value)}
                  />
                </FormGroup>
                <FormGroup>
                  <Label for="questionsFile">Upload Questions:</Label>
                  <Input
                    type="file"
                    id="questionsFile"
                    onChange={(e) => setQuestionsFile(e.target.files[0])}
                  />
                </FormGroup>
                <Button color="primary" onClick={handleAddExam}>Add Exam</Button>
              </CardBody>
            </Card>
          </Col>
        </Row>
        <Row>
          <Col md="12">
            <Card>
              <CardHeader>
                <h5 className="title">Added Exams</h5>
              </CardHeader>
              <CardBody>
                <Table responsive>
                  <thead className="text-primary">
                    <tr>
                      <th>Batch ID</th>
                      <th>Date</th>
                      <th>Time</th>
                      <th>Questions File</th>
                    </tr>
                  </thead>
                  <tbody>
                    {exams.map((exam, index) => (
                      <tr key={index}>
                        <td>{exam.batchId}</td>
                        <td>{exam.date}</td>
                        <td>{exam.time}</td>
                        <td>{exam.questionsFile ? exam.questionsFile.name : ""}</td>
                      </tr>
                    ))}
                  </tbody>
                </Table>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </div>
    </>
  );
}

export default Typography;
